import React from 'react'
import Products from '../components/products'

const Productss = () => {
  return (
    <>
    <PageBanner
   heading="Contact Us"
   breadcrumbLinks={[
     { label: 'Home', href: '/' },
     { label: 'Contact', href: '/contact' }
   ]}
 />
    <Products showAll={true} />
    </>
  );
}

export default Productss
